  SIGNAL switch_compare_1                 : std_logic;
  SIGNAL Premble_LUT_Output               : std_logic;
  SIGNAL Premble_LUT_Output_1             : std_logic := '0';
  SIGNAL Constant3_out1                   : std_logic;
  SIGNAL output_of_Preamble_switch        : std_logic;
  SIGNAL Constant7_out1                   : std_logic;
  SIGNAL PTT_for_data                     : std_logic;
  SIGNAL output_2                         : std_logic;
  SIGNAL switch_compare_1_1               : std_logic;
  SIGNAL Constant11_out1                  : std_logic;
  SIGNAL output_of_data_switch            : std_logic;
  SIGNAL output_of_data_switch_1          : std_logic;
  SIGNAL preamble_or_data_add_cast        : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL preamble_or_data_add_cast_1      : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL preamble_or_data_out1            : unsigned(8 DOWNTO 0);  -- ufix9

BEGIN
  u_preamble_sample_and_hold : opv_modul_ip_src_preamble_sample_and_hold
    PORT MAP( clk => clk,
              reset => reset,
              enb_1_307200_0 => clk_enable,
              input => Constant1_out1,
              reset_1 => Delay1_out1,
              trigger => Preamble_count_hit_delayed,
              output => output
              );

  u_data_sample_and_hold : opv_modul_ip_src_data_sample_and_hold
    PORT MAP( clk => clk,
              reset => reset,
              enb_1_307200_0 => clk_enable,
              input => Constant7_out1,
              reset_1 => PTT_for_data,
              trigger => output,
              output => output_2
              );

  Constant1_out1 <= '1';

  Preamble_SH_reset_signal <=  NOT PTT;

  enb_1_307200_0 <= clk_enable;

  Delay1_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      Delay1_out1 <= '0';
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        Delay1_out1 <= Preamble_SH_reset_signal;
      END IF;
    END IF;
  END PROCESS Delay1_process;


  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 2168
  count_step <= to_unsigned(16#0001#, 16);

  count_from <= to_unsigned(16#0000#, 16);

  count_reset <= to_unsigned(16#0000#, 16);

  count <= Preamble_Count + count_step;

  
  count_value <= count WHEN need_to_wrap = '0' ELSE
      count_from;

  
  count_1 <= Preamble_Count WHEN PTT = '0' ELSE
      count_value;

  
  count_2 <= count_1 WHEN Preamble_SH_reset_signal = '0' ELSE
      count_reset;

  preamble_counter_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      Preamble_Count <= to_unsigned(16#0000#, 16);
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        Preamble_Count <= count_2;
      END IF;
    END IF;
  END PROCESS preamble_counter_process;


  
  need_to_wrap <= '1' WHEN Preamble_Count = to_unsigned(16#0878#, 16) ELSE
      '0';

  
  range_hit <= '1' WHEN Preamble_Count > to_unsigned(16#FFFE#, 16) ELSE
      '0';

  count_hit <= need_to_wrap OR range_hit;

  zero_1 <= '0';

  
  Preamble_count_hit <= count_hit WHEN Preamble_SH_reset_signal = '0' ELSE
      zero_1;

  Delay_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      Preamble_count_hit_delayed <= '0';
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        Preamble_count_hit_delayed <= Preamble_count_hit;
      END IF;
    END IF;
  END PROCESS Delay_process;


  delayMatch_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      output_1 <= '0';
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        output_1 <= output;
      END IF;
    END IF;
  END PROCESS delayMatch_process;


  
  switch_compare_1 <= '1' WHEN output_1 > '0' ELSE
      '0';

  Premble_LUT_Output <= preamble_values_table_data(to_integer(Preamble_Count));

  PipelineRegister_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        Premble_LUT_Output_1 <= Premble_LUT_Output;
      END IF;
    END IF;
  END PROCESS PipelineRegister_process;


  Constant3_out1 <= '0';

  
  output_of_Preamble_switch <= Premble_LUT_Output_1 WHEN switch_compare_1 = '0' ELSE
      Constant3_out1;

  Constant7_out1 <= '1';

  PTT_for_data <=  NOT output;

  
  switch_compare_1_1 <= '1' WHEN output_2 > '0' ELSE
      '0';

  Constant11_out1 <= '0';

  
  output_of_data_switch <= Constant11_out1 WHEN switch_compare_1_1 = '0' ELSE
      data;

  delayMatch1_process : PROCESS (clk, reset)
  BEGIN
    IF reset = '1' THEN
      output_of_data_switch_1 <= '0';
    ELSIF clk'EVENT AND clk = '1' THEN
      IF enb_1_307200_0 = '1' THEN
        output_of_data_switch_1 <= output_of_data_switch;
      END IF;
    END IF;
  END PROCESS delayMatch1_process;


  preamble_or_data_add_cast <= '0' & '0' & '0' & '0' & '0' & '0' & '0' & '0' & output_of_Preamble_switch;
  preamble_or_data_add_cast_1 <= '0' & '0' & '0' & '0' & '0' & '0' & '0' & '0' & output_of_data_switch_1;
  preamble_or_data_out1 <= preamble_or_data_add_cast + preamble_or_data_add_cast_1;

  Out1 <= std_logic_vector(preamble_or_data_out1);

  ce_out <= clk_enable;

END rtl;

